  return (
    <div className={classes.mainContainer}>
      <AuthImage />
      <div className={classes.formContainer}>
        <p>Confirmation Code</p>
        <form action="" >
          <div className={classes.form}>
            <input type="text" maxlength="1" required />
            <input type="text" maxlength="1" required />
            <input type="text" maxlength="1" required />
            <input type="text" maxlength="1" required />
          </div>
        </form>
      </div>
    </div>
  );
};

export default ConfirmForgottenPasswordCode;
